  `nam_sinh` int DEFAULT NULL,
  PRIMARY KEY (`ma_tac_gia`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

INSERT INTO `tbl_tac_gia` (`ma_tac_gia`, `anh`, `bi_danh`, `hien`, `ten_tac_gia`, `mo_ta`, `noi_dung`, `nam_sinh`) VALUES
	(1, 'data:image/webp;base64,', 'to-huu', b'1', 'Tố Hữu', 'Nguyễn Kim Thành, thường được biết đến với bút danh Tố Hữu (4 tháng 10 năm 1920 – 9 tháng 12 năm 2002), là một cố nhà thơ kiêm chính trị gia người Việt Nam.', 'Tố Hữu tên khai sinh là Nguyễn Kim Thành. Ông sinh ngày 4 tháng 10 năm 1920 tại thành phố Huế, là con út trong gia đình. Đến năm 9 tuổi, ông cùng cha trở về sống tại làng Phù Lai, nay thuộc xã Quảng Thọ, huyện Quảng Điền, thành phố Huế. Cha ông là một nhà nho nghèo, không đỗ đạt và phải kiếm sống rất chật vật nhưng lại thích thơ, thích sưu tập ca dao tục ngữ. Ông đã dạy Tố Hữu làm thơ cổ. Mẹ ông cũng là con của một nhà nho nghèo nhưng thuộc nhiều ca dao dân ca Huế và rất yêu thương con. Cha mẹ đã góp phần nuôi dưỡng tâm hồn thơ Tố Hữu.[1]\r\n\r\nMẹ ông mất vào năm ông lên 12 tuổi. Năm 13 tuổi, ông vào trường Quốc học Huế. Tại đây, được trực tiếp tiếp xúc với tư tưởng của Karl Marx, Friedrich Engels, Vladimir Ilyich Lenin, Maksim Gorky,... và qua sách báo, kết hợp với sự vận động của các đảng viên của Đảng Cộng sản Việt Nam bấy giờ (Lê Duẩn, Phan Đăng Lưu, Nguyễn Chí Diểu), Nguyễn Kim Thành sớm tiếp cận với lý tưởng cộng sản. Năm 1936, ông gia nhập Đoàn thanh niên Dân chủ Đông Dương..', 1920),
	(2, 'data:image/jpeg;base64,', 'to-hoai', b'0', 'Tô Hoài', 'Tô Hoài (tên thật là: Nguyễn Sen; 27 tháng 9 năm 1920 – 6 tháng 7 năm 2014) là một nhà văn Việt Nam được tặng Giải thưởng Hồ Chí Minh về Văn học Nghệ thuật năm 1996. Ông là Tổng Thư ký đầu tiên của Hội Nhà văn Việt Nam (1957-1963). Dế Mèn phiêu lưu ký là tác phẩm được nhiều người biết nhất của ông dành cho thiếu nhi.', 'Tô Hoài sinh ngày 27 tháng 9 năm 1920 tại quê nội thôn Cát Động, Thị trấn Kim Bài, huyện Thanh Oai (nay là xã Thanh Oai), thành phố Hà Nội trong một gia đình thợ thủ công.[1] Ông lớn lên ở quê ngoại xã Nghĩa Đô, huyện Từ Liêm (nay là phường Nghĩa Đô), thành phố Hà Nội. Bút danh Tô Hoài gắn với hai địa danh: sông Tô Lịch và phủ Hoài Đức.\r\n\r\nĐến tuổi thanh niên, ông đã phải làm nhiều việc để kiếm sống như dạy trẻ, bán hàng, kế toán hiệu buôn,... và có những lúc thất nghiệp. Năm 1943, Tô Hoài gia nhập Hội Văn hóa cứu quốc. Trong chiến tranh Đông Dương, ông chủ yếu hoạt động trong lĩnh vực báo chí, nhưng vẫn có một số thành tựu quan trọng về văn học như Truyện Tây Bắc.\r\n\r\nTừ năm 1954 trở đi, ông tập trung vào sáng tác. Ông là thành viên sáng lập và là Tổng Thư ký đầu tiên của Hội Nhà văn Việt Nam (1957-1963).\r\n\r\nÔng mất ngày 6 tháng 7 năm 2014 tại Hà Nội.', 1920),
	(3, 'data:image/jpeg;base64,', 'nam-cao', b'0', 'Nam Cao', 'Nam Cao (nguyên danh Trần Hữu Tri, thánh danh Giuse[1], 29 tháng 10, năm 1915 hoặc 1917 – 30 tháng 11 năm 1951[2]) là một nhà văn, nhà báo và cũng là một chiến sĩ, liệt sĩ,Anh hùng Lực lượng vũ trang nhân dân Việt Nam (truy tặng năm 1996). Ông là nhà văn hiện thực lớn (trước Cách mạng Tháng Tám), một nhà báo kháng chiến (sau Cách mạng), một trong những nhà văn người Việt Nam tiêu biểu nhất thế kỷ 20. Nam Cao có nhiều đóng góp quan trọng đối với việc hoàn thiện phong cách truyện ngắn và tiểu thuyết Việt Nam ở nửa đầu thế kỷ 20.', 'Nam Cao tên khai sinh là Trần Hữu Tri (có nguồn ghi là Trần Hữu Trí[3]), sinh ngày 29 tháng 10 năm 1915 nhưng giấy khai sinh ghi là 1917.[4] Quê ông tại làng Đại Hoàng, tổng Cao Đà, huyện Nam Sang, phủ Lý Nhân (nay là xã Nam Lý, tỉnh Ninh Bình). Ông đã ghép hai chữ đầu tiên của tên tổng và huyện làm bút danh: Nam Cao.[5]\r\n\r\nÔng xuất thân từ một gia đình Công giáo ở vùng nông thôn. Cha của ông là ông Trần Hữu Huệ, làm và kinh doanh nghề mộc, có thời gian làm nghề thầy lang trong làng. Mẹ của ông là bà Trần Thị Minh, vừa là nội trợ, làm vườn, làm ruộng và dệt vải.\r\n\r\nThuở nhỏ, Nam Cao đi học sơ học ở trường làng. Đến cấp tiểu học và bậc trung học, gia đình gửi ông xuống Nam Định học ở trường Cửa Bắc rồi trường Thành Chung (nay là trường Trung học phổ thông chuyên Lê Hồng Phong, Nam Định). Năm 1934 học xong bậc trung học, nhưng bị ngã và đau ốm nên chưa thi lấy bằng Thành Chung. Đầu năm 1935 cưới vợ, Trần Thị Sen (tên thánh Maria Sen), người cùng làng. Tháng 11/1935 Nam Cao vào Sài Gòn, ở lại đây 30 tháng, sống bằng nghề làm thư ký hiệu may Ba Lễ, đồng thời bắt đầu viết văn, gửi cho các báo. Năm 1936 được đăng các truyện ngắn "Cảnh cuối cùng" và "Hai cái xác" dưới bút danh Thúy Rư trên tuần báo Tiểu thuyết thứ bảy (Hà Nội). Năm 1937 được đăng các truyện ngắn "Một bà hào hiệp", "Nghèo", "Đui mù" dưới bút danh Thúy Rư trên Tiểu thuyết thứ bảy, Truyện "Những cánh hoa tàn" trên báo Ích Hữu (Hà Nội). Tháng 5 năm 1938, vì lí do sức khoẻ, Nam Cao trở ra Bắc, về quê.', 1915);

